package BT4_Trang;

public class Diachi {
	private String soNha, ngach, ngo, duong, phuong, quan, thanhPho;

	public Diachi(String soNha, String ngach, String ngo, String duong, String phuong, String quan, String thanhPho) {
		super();
		this.soNha = soNha;
		this.ngach = ngach;
		this.ngo = ngo;
		this.duong = duong;
		this.phuong = phuong;
		this.quan = quan;
		this.thanhPho = thanhPho;
	}

	public Diachi() {
		super();
		// TODO Auto-generated constructor stub
	}

	public String getSoNha() {
		return soNha;
	}

	public void setSoNha(String soNha) {
		this.soNha = soNha;
	}

	public String getNgach() {
		return ngach;
	}

	public void setNgach(String ngach) {
		this.ngach = ngach;
	}

	public String getNgo() {
		return ngo;
	}

	public void setNgo(String ngo) {
		this.ngo = ngo;
	}

	public String getDuong() {
		return duong;
	}

	public void setDuong(String duong) {
		this.duong = duong;
	}

	public String getPhuong() {
		return phuong;
	}

	public void setPhuong(String phuong) {
		this.phuong = phuong;
	}

	public String getQuan() {
		return quan;
	}

	public void setQuan(String quan) {
		this.quan = quan;
	}

	public String getThanhPho() {
		return thanhPho;
	}

	public void setThanhPho(String thanhPho) {
		this.thanhPho = thanhPho;
	}

}
